import React, { Fragment } from "react";

const PurchaseBox = () => {
  return (
    <Fragment>
      <div className="purchaseBoxContainer">
        <div className="purchaseBox">
          <div className="time">
            <p>1 hour</p>
          </div>
          <div className="discountPrice">

          </div>
        </div>
      </div>
    </Fragment>
  );
};

export default PurchaseBox;
